function Page({total,record}){
    let n= Math.ceil(total/record)
    // console.log(n)
    let page=[]
    for (let i=1 ; i<=n; i++){
        console.log(i)
        page.push(i)
    }
    console.log(page)
    return(
        <div>
             <ul className="pagination">
                {page.map((one)=>(
                  <li className="page-one">
                      <a href="#" className="page-link"  onClick={()=>{updata(one)}}>{one}</a>
                  </li>
                ))}
             </ul>
        </div>
    )
}

export default Page;
